import './Recommended.css'
import Rental from './Rental'
import Button from './Button'



function Recommended(){
    state = { data: "fa-solid fa-angle-right" }
    state2 = { data: "fa-solid fa-angle-left" }
    return(
        <div id="rec-stays">
            <h1>Recommended Stays</h1> 
            <Button icon = { this.state.data } />
            <Rental />
            <Rental />
            <Rental />
            <Button icon = { this.state2.data } />
                     
        </div>
    );
}

export default Recommended;
